import React from "react";

import classes from "./Header.module.css";
import mealsImg from "../../assets/meals.jpg";

const Header = (props) => {
  return (
    <React.Fragment>
      <header className={classes.header}>
          <h1>React Meals</h1>
          <button>Cart</button>
      </header>
      <div>
        <img src={mealsImg} alt="Food full of table" />
      </div>
    </React.Fragment>
  );
};

export default Header;
